package com.example.kotlin1hw2

import androidx.appcompat.app.AppCompatActivity
import android.os.Bundle
import android.util.Patterns
import android.widget.Toast
import com.example.kotlin1hw2.databinding.ActivityMainBinding
import com.example.kotlin1hw2.extensions.loadImage

class MainActivity : AppCompatActivity() {

    private val mutableList = mutableListOf<String>()
    private lateinit var binding: ActivityMainBinding

    override fun onCreate(savedInstanceState: Bundle?) {
        super.onCreate(savedInstanceState)
        binding = ActivityMainBinding.inflate(layoutInflater)
        val view = binding.root
        setContentView(view)
        imageHolder()
        generateButton()
        randomButton()

    }

    private fun randomButton() {
        binding.randomButton.setOnClickListener {
            binding.imageView.loadImage(mutableList.random())
        }
    }

    private fun generateButton() {
        binding.generateButton.setOnClickListener{
            val url = binding.editText.text.toString()
            if (Patterns.WEB_URL.matcher(url).matches()) {
                mutableList.add(url)
                binding.imageView.loadImage(url)
            }else Toast.makeText(this, getString(R.string.warning), Toast.LENGTH_LONG).show()
        }
    }

    private fun imageHolder() {
        mutableList.add("data:image/png;base64,")
        mutableList.add("data:image/png;base64,")
        mutableList.add("data:image/png;base64,")
        mutableList.add("data:image/png;base64,")
        mutableList.add("data:image/png;base64,")

    }

}